import React from 'react';
import './home.css';
import image from '../../image/image.png';

import About from '../About/About';
import Contact from '../Contact/Contact';
import Projects from '../Projects/Projects';
import Skills from '../Skills/Skills';
import Education from '../Education/Education';
import Experience from '../Experience/Experience';

const Home = () => {
    return (
        <div className="home-container">
            {/* Profile Image Section */}
            <div className="image-section">
                <div className="image-wrapper">
                    <img src={image} alt="Vishal Kumar" className="profile-image" />
                    <div className="full-name">Vishal Kumar</div>
                </div>
            </div>

            {/* Use <section> with id for scrollspy tracking */}
            <section id="about" className="section-wrapper about-wrapper">
                <About />
            </section>

            <section id="contact" className="section-wrapper contact-wrapper">
                <Contact />
            </section>

            <section id="projects" className="section-wrapper projects-wrapper">
                <Projects />
            </section>

            <section id="skills" className="section-wrapper projects-wrapper">
                <Skills />
            </section>

            <section id="education" className="section-wrapper projects-wrapper">
                <Education />
            </section>

            <section id="experience" className="section-wrapper projects-wrapper">
                <Experience />
            </section>
        </div>
    );
};

export default Home;
